import "../styles/Main.scss"
import { Link } from "react-router-dom";

function Navbar() {
	return (
		<div style={{ display: "flex", justifyContent: "space-between" }}>
			<div style={{display: "flex"}}>
				<p>Burger</p>
                <Link to={'/movies'}>
				Movies
                </Link>
				<p>Series</p>
			</div>
			<p>MoviesSearch</p>
			<div style={{display:"flex"}}>
				<p className={"test"}>Search</p>
				<p>Profile</p>
			</div>
		</div>
	);
}

export default Navbar;
